          {
            "segment": {
              "startIndex": 323,
              "endIndex": 418,
              "text": "Sea otters have the **thickest fur** of any animal, with up to 1 million hairs per square inch."
            },
            "groundingChunkIndices": [
              5,
              1
            ]
          },
          {
            "segment": {
              "startIndex": 419,
              "endIndex": 560,
              "text": "*   **Habitat:** Most species (like river otters) live in freshwater environments like rivers and lakes but spend much of their time on land."
            },
            "groundingChunkIndices": [
              0
            ]
          },
          {
            "segment": {
              "startIndex": 561,
              "endIndex": 644,
              "text": "Sea otters are almost entirely marine, often living their whole lives in the ocean."
            },
            "groundingChunkIndices": [
              5,
              0,
              6,
              3
            ]
          },
          {
            "segment": {
              "startIndex": 645,
              "endIndex": 744,
              "text": "*   **Diet:** They primarily eat fish, but their diet can also include frogs, crabs, and shellfish."
            },
            "groundingChunkIndices": [
              0
            ]
          },
          {
            "segment": {
              "startIndex": 745,
              "endIndex": 882,
              "text": "*   **Behavior:** Otters are highly intelligent and famous for their **playful nature**, often sliding into water or playing with stones."
            },
            "groundingChunkIndices": [
              0
            ]
          },
          {
            "segment": {
              "startIndex": 884,
              "endIndex": 1027,
              "text": "*   **Tool Use:** Sea otters are among the few mammals that use tools, often using rocks to crack open shellfish while floating on their backs."
            },
            "groundingChunkIndices": [
              5,
              6,
              0
            ]
          }
