  **Dense Fur:** They have the thickest fur of any mammal—up to **1 million hairs per square inch**."},"groundingChunkIndices": [8,2,9,11]},{"segment": {"startIndex": 341,"endIndex": 414,"text": "This provides insulation and buoyancy since they lack a layer of blubber."},"groundingChunkIndices": [1,2]},{"segment": {"startIndex": 415,"endIndex": 561,"text": "*   **Tool Use:** Sea otters are among the few mammals that use tools; they often use rocks to crack open shellfish while floating on their backs."},"groundingChunkIndices": [6,4,11,2]},{"segment": {"startIndex": 562,"endIndex": 624,"text": "*   **Social Behavior:** They are famously playful and social."},"groundingChunkIndices": [5,0,2,10]},{"segment": {"startIndex": 625,"endIndex": 744,"text": "Sea otters sometimes hold paws while sleeping (a behavior called **rafting**) to prevent drifting apart in the current."},"groundingChunkIndices": [4,2]},{"segment": {"startIndex": 745,"endIndex": 840,"text": "*   **Diet:** They are opportunistic hunters, primarily eating fish, crustaceans, and mollusks."},"groundingChunkIndices": [10]},{"segment": {"startIndex": 940,"endIndex": 959,"text": "### Notable Species"},"groundingChunkIndices": [2,1,7,9,0,10]},{"segment": {"startIndex": 960,"endIndex": 1079,"text": "*   **Sea Otter:** The heaviest species, found in the North Pacific; they spend almost their entire lives in the ocean."},"groundingChunkIndices": [10,2]},{"segment": {"startIndex": 1080,"endIndex": 1215,"text": "*   **Giant River Otter:** The longest species, reaching up to **6 feet** in length; they live in the Amazon and hunt in family groups."},"groundingChunkIndices": [10,2]},{"segment": {"startIndex": 1216,"endIndex": 1316,"text": "*   **Asian Small-Clawed Otter:** The smallest species, known for their dexterity and social nature."},"groundingChunkIndices": [10,2]},{"segment": {"startIndex": 1318,"endIndex": 1387,"text": "### Ecological Importance
Otters are considered **keystone species**."},"groundingChunkIndices": [9,1,2]},{"segment": {"startIndex": 1388,"endIndex": 1525,"text": "For example, sea otters protect kelp forests by eating sea urchins, which would otherwise overgraze and destroy the underwater ecosystem."},"groundingChunkIndices": [10,2]},{"segment": {"startIndex": 1526,"endIndex": 1633,"text": "Unfortunately, many species are currently threatened by habitat loss, pollution, and the illegal pet trade."},"groundingChunkIndices": [9,2]}],"webSearchQueries": ["interesting otter behaviors and characteristics","types of otters and their habitats","brief facts about otters"]}}],"usageMetadata": {"promptTokenCount": 12,"candidatesTokenCount": 349,"totalTokenCount": 16696,"promptTokensDetails": [{"modality": "TEXT","tokenCount": 12}],"toolUsePromptTokenCount": 16335,"toolUsePromptTokensDetails": [{"modality": "TEXT","tokenCount": 16335}]},"modelVersion": "gemini-3-flash-preview","responseId": "kGGGaZ2EDvS6juMPoOqNsAo"}

